import React from "react";

function  Card(props){

return(
<div>
<h2>
    {props.name}
</h2>

<p>ello</p>
<p>hi </p>
</div>

);
}

ReactDom.render (
<div>
<h1>neha darling!</h1>
<Card 
name= 'itsmeneha' 
ello = '93'  
hi ='somthing'>

</Card>

</div>, 
document.getElementById ("root")
);
